看起来有一个JavaScript错误：`currentY is not defined`，发生在 `<anonymous>:27:7`。这可能是在我们的新图形代码中有一个错误。让我检查 `renderContainerNode` 函数，看看是否有 `currentY` 没有正确定义。

看起来问题可能是在 `renderContainerNode` 函数中，在返回语句那里。让我仔细检查一下代码：

```javascript
function renderContainerNode(parent, node, x, y, depth) {
  const nodeId = node.id || node.name || 'root';
  const isExpanded = expandedNodes.has(nodeId);
  const hasChildren = node.children && node.children.length > 0;

  const g = document.createElementNS('http://www.w3.org/2000/svg', 'g');
  g.setAttribute('transform', `translate(${x + depth * 20}, ${y})`);

  // ... rest of code ...

  // Draw children if expanded
  if (hasChildren && isExpanded) {
    let currentY = y + 35;
    node.children.forEach((child) => {
      // Connection line
      const line = document.createElementNS('http://www.w3.org/2000/svg', 'line');
      line.setAttribute('x1', String(10 + depth * 20));
      line.setAttribute('y1', String(y + 28));
      line.setAttribute('x2', String(10 + (depth + 1) * 20));
      line.setAttribute('y2', String(currentY + 14));
      line.setAttribute('stroke', '#666');
      line.setAttribute('stroke-width', '1');
      parent.appendChild(line);

      renderContainerNode(parent, child, x, currentY, depth + 1);
      currentY += 35;
    });
  }

  return currentY - y;
}
```

I see the issue now. The `currentY` variable is only declared inside the `hasChildren && isExpanded` block, but it's being returned at the function end. This means when there are no children or the node isn't expanded, `currentY` will be undefined, causing the error.

I'll move the `currentY` variable declaration outside of the conditional block to ensure it's always defined. This way, regardless of whether the node has children or is expanded, the function will always have a valid `currentY` value to return.
